&lt;p&gt;
	Since the inspection I have carried out the following improvements:&lt;/p&gt;
&lt;ul&gt;
	&lt;li&gt;
		the establishment has been thoroughly cleaned and procedures are in place to ensure that cleanliness is maintained;&lt;/li&gt;
	&lt;li&gt;
		the staff have been re-trained and under revised supervisory arrangements;&lt;/li&gt;
	&lt;li&gt;
		the relevant documents printed;&lt;/li&gt;
	&lt;li&gt;
		temperatures checked and entered in daily diary;&lt;/li&gt;
	&lt;li&gt;
		a fly net has been fitted to the kitchen window and,&lt;/li&gt;
	&lt;li&gt;
		delivery temperature checks are in place.&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;
	The conditions found at the time of the inspection were not typical of the normal conditions maintained by the establishment and arose because preparation of a pasta dish was completed as a one off and prior to that had not happened since last October.&amp;nbsp; It is not a regular thing and from now on I will make sure that every time cooling like this happens, cooling procedures are in place.&amp;nbsp; Our kitchen handles very low risk food.&lt;/p&gt;
